styles:
         .sidebar {
         position: absolute;
         top: 0px;
         bottom: 0px;
         left: 0px;
         display: inline-block;
         width: 332px;
         }
         .sidebar {
         background-color: #0072C6;
         }
         .sidebar .owaLogoContainer {
         margin: 40vh auto auto 109px;
         text-align: left /* Logo aligns left for both ltr & rtl */;
         }
         .login-box{
         padding-left: 0;
         width: 100%;
         }
         @media (min-width: 576px) { 
         .login-box{
         padding-left: 332px;
         }
         }
         @media (min-width: 768px) { 
         .login-box{
         padding-left: 332px;
         }
         }
         @media (min-width: 992px) { 
         .login-box{
         padding-left: 332px;
         }
         }
         @media (min-width: 1200px) { 
         .login-box{
         padding-left: 332px;
         }
         }
         #fixedContainer
         {
         position: fixed;
         width: 350;
         height: 400px;
         left: 50%;
         top: 30%;
         margin-left: -100px;
         }
         input {
         outline: none;
         display: block;
         width: 80%;
         margin: 0 0 20px;
         padding: 10px 15px;
         border: 1px solid #ccc;
		 font-family: sans-serif;
         box-sizing: border-box;
         font-size: 14px;
         font-wieght: 400;
         -webkit-font-smoothing: antialiased;
         -moz-osx-font-smoothing: grayscale;
         transition: 0.2s linear;
         &input:focus {
         color: #333;
         border: 1px solid #44c4e7;
         }
         }
         body{    background-color: #fdfdfd;
         }
         #img
         {
         width: 350px;
         margin-bottom: 30px;
         }
         span
         {
         font-family: sans-serif;
         color: #7d7d7d;
         }
         .error
         {
         font-family: sans-serif;
         color: red;
         font-size: smaller;
         }
